        fieldname:'',
        fieldicon:'',
        explanation_d:'<P class=MsoNormal style=\"MARGIN: 0cm 0cm 10pt\"><SPAN style=\"FONT-SIZE: 12pt; LINE-HEIGHT: 115%; FONT-FAMILY: \'Arial\',\'sans-serif\'\">After each week the capacity is adjusted by using continuous planning. This is shown in the figure below:<?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P><SPAN style=\"FONT-SIZE: 12pt; LINE-HEIGHT: 115%; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><SPAN style=\"FONT-SIZE: 12pt; LINE-HEIGHT: 115%; FONT-FAMILY: \'Arial\',\'sans-serif\'\">\n<P class=MsoNormal style=\"MARGIN: 0cm 0cm 10pt\"><SPAN style=\"FONT-SIZE: 12pt; LINE-HEIGHT: 115%; FONT-FAMILY: \'Arial\',\'sans-serif\'\"><IMG alt=\"\" hspace=0 src=\"pages/contPlanning.JPG\" align=baseline border=0></SPAN></P><SPAN style=\"FONT-SIZE: 12pt; LINE-HEIGHT: 115%; FONT-FAMILY: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA\">In the first week, deployment sends the confirmed distribution amounts (<STRONG>a</STRONG>) to TP/VS. After running TP/VS optimization, the adjustment factor is calculated leading to an adjustment in the capacity for deployment (<STRONG>b</STRONG>). Note that if there are any non-deliveries in the TP/VS optimization they can be added to the planning run of the next week, though only orders from Thursday and Friday due to the maximum delivery delay of 5 days. If in the next week there is still not enough vehicle capacity to deliver the orders, they are deleted permanently from the system. In the second week deployment uses the newly calculated capacity for its run, and then it sends the confirmed distribution amounts (<STRONG>c</STRONG>) to TP/VS. Additional weeks can be launched the same way. This is the end of this lesson.</SPAN></SPAN></SPAN>',
